const CvContactLink = () => {
  return (
    <ul className="grid grid-cols-4 gap-4">
      <li className="rounded-lg bg-orange-50 hover:bg-[#0a66c2] p-2 cursor-pointer hover:text-white duration-300 text-center  hover:translate-y-[-0.25rem] hover:shadow-buttonShadow">
        LinkedIn
      </li>
      <li className="rounded-lg bg-orange-50 hover:bg-[#0D1117] p-2 cursor-pointer hover:text-white duration-300 text-center  hover:translate-y-[-0.25rem] hover:shadow-buttonShadow">
        GitHub
      </li>
      <li className="rounded-lg bg-orange-50 hover:bg-[#28A8EA] p-2 cursor-pointer hover:text-white duration-300 text-center  hover:translate-y-[-0.25rem] hover:shadow-buttonShadow">
        Telegram
      </li>
      <li className="rounded-lg bg-orange-50 hover:bg-[#5562EA] p-2 cursor-pointer hover:text-white duration-300 text-center  hover:translate-y-[-0.25rem] hover:shadow-buttonShadow">
        Discord
      </li>
    </ul>
  );
};

export default CvContactLink;
